import Axios from "axios";

export const LoginUser = async (req) => {
  console.log("Nhap tt-----", req);
  const respod = await Axios.post("http://localhost:8080/Auth/", req);
  console.log("respond-------", respod);
  if (respod.data.success) {
    localStorage.setItem("token", respod.Accesstoken);
  }

  return respod.data;
};
